import React, { useState } from "react";
import "./Signup.css";
import { Link } from "react-router-dom";
import Input from "../components/Input";
import { Button } from "../components/Button";

const Signup = () => {
  const [firstname, setFirstname] = useState("");
  const [lastname, setLastname] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");

  return (
    <div className="Signup">
      <h1> SIGN UP</h1>
      <Link className="Link" to="/">
        <h2 className="sign"> Login</h2>
      </Link>

      <div className="flex">
        <div className="in">
          <Input place="First name" />
        </div>
        <div className="put">
          <Input place="Last Name" />
        </div>
      </div>

      <Input className="input" place="Email" />

      <Input className="input" type="password" place="Password" />

      <Input type="password" place="Confirm Password" />

      <Link className="Link" to="/Todolist">
        <Button />
      </Link>
    </div>
  );
};

export default Signup;
